import Header from '../components/Header'
import {useState} from 'react';
import BashboardMenu from '../components/BashboardMenu'
const Dashboard = (props)=>{

    const [activeTab,setActiveTab] = useState('Home');
    console.log(activeTab);
    return (
        <div>
          <Header onlyBanner={true} />
          <div className="my-4 login-bg py-4">
            <div className="max-w-7xl borderd rounded-lg bg-white mx-auto flex">
              <div className="w-44 p-2">
                <BashboardMenu activeTab={activeTab} setActiveTab={setActiveTab} />
              </div>
              <div className="w-auto">
                <span>Content Pane</span>
              </div>
            </div>
          </div>
        </div>
      );
}
export default Dashboard;
